import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin, faTwitter, faDev, faInstagram } from '@fortawesome/free-brands-svg-icons';
import './social.css';

function Social() {
  return (
    <div className="social-media-links">
      <a href="https://github.com/SwavikPatra" target="_blank" rel="noopener noreferrer">
        <FontAwesomeIcon icon={faGithub} />
      </a>
      <a href="https://www.linkedin.com/in/swavik-patra-140482231/" target="_blank" rel="noopener noreferrer">
        <FontAwesomeIcon icon={faLinkedin} />
      </a>
      <a href="https://twitter.com/kunuswavik" target="_blank" rel="noopener noreferrer">
        <FontAwesomeIcon icon={faTwitter} />
      </a>
      <a href="https://leetcode.com/u/Swavik/" target="_blank" rel="noopener noreferrer">
        <FontAwesomeIcon icon={faDev} />
      </a>
      <a href="https://www.instagram.com/kunuswavik/" target="_blank" rel="noopener noreferrer">
        <FontAwesomeIcon icon={faInstagram} />
      </a>
    </div>
  );
}

export default Social;
